import './styles.css'
import {RECIPE} from './recipe-data'
//import CUPCAKE_IMG from '../../assets/cupcake.jpg'
import IngredientList from './IngredientList'
const RecipeCard  = () => {
    return (
        <div className="card">
            <img src = {RECIPE.imgSrc} alt = "cupcake" className = "recipe_image" />
            <IngredientList ingredients = {RECIPE.ingredients} title = "Ingredients"/>
            <div>
            <h2>Instructions</h2>
            <ul>
                {RECIPE.instructions.map((ingred, index) => (
                    <li key = {index}>{ingred}</li>
                ))}
            </ul>
            </div>
        </div>
    )
}
export default RecipeCard
